import React from 'react';

function Login() {
  return (
    <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
      <div style={{ padding: '20px', backgroundColor: 'white', width: '25%', border: '1px solid #ccc' }}>
        <form>
          <div style={{ marginBottom: '15px' }}>
            <label htmlFor="email">Email</label>
            <input type="email" id="email" placeholder="Enter Email" style={{ width: '100%', padding: '5px' }} />
          </div>
          <div style={{ marginBottom: '15px' }}>
            <label htmlFor="password">Password</label>
            <input type="password" id="password" placeholder="Enter Password" style={{ width: '100%', padding: '5px' }} />
          </div>
          <button style={{ backgroundColor: 'green', color: 'white', padding: '8px 15px', border: 'none', cursor: 'pointer' }}>Login</button>
        </form>
      </div>
    </div>
  );
}

export default Login;
